import React from 'react';
import style from 'styled-components';
import MovieCard from '../components/MovieCard';

const ListTitle = style.h1`

  color: white;
  font-weight: bold;
  text-align: left;
  font-size: 48px;
  margin-bottom: 73px;

`;

const Wrapper = style.div`

    margin: 10.21% 22% 5.07% 22%;

`;

const NominateWrapper = style.div`

    margin-top: 33px;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;


`;

export default function UserList({ movies }) {
    return (
        <Wrapper>
            <ListTitle>
                My List
            </ListTitle>
            <NominateWrapper>
                {
                    movies.map((movie) => {
                        return <MovieCard removeMovbtnLabel={"Remove"} movie={movie}/>
                    })
                }
            </NominateWrapper>
        </Wrapper>
    )
}
